--
-- Table structure for table `information_pages`
--

DROP TABLE IF EXISTS `information_pages`;
CREATE TABLE IF NOT EXISTS `information_pages` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `page` varchar(255) NOT NULL,
  `info` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

--
-- Dumping data for table `information_pages`
--

INSERT INTO `information_pages` (`id`, `page`, `info`) VALUES
(1, 'rules', '<h1>Rules</h1>\r\n\r\n<p>Scores must be submitted prior to the kick off of any match. The score entry boxes for the games on your predictions page will be disablled at the match kick off time. Entry of scores is the responsibility of each individual player however a fixture card will be put in the whatsapp group as well as left in the bar each week.</p>\r\n\r\n<p>Points are awarded as follows:</p>\r\n\r\n<ul>\r\n	\r\n	<li>1 point for a correct home result</li>\r\n	<li>2 point for a correct away result</li>\r\n	<li>3 point for a correct draw result</li>\r\n	<li>5 bonus points for correct score</li>\r\n\r\n</ul>\r\n\r\n<p>If any player gets all 6 match results correct in a game week that player will receive £10 from every other player. All money should be paid to Craig at the bar and he will pass it on to the player(s) who had all 6 match results correct.</p>\r\n\r\n<p><strong>Entry Fee</strong></p>\r\n\r\n<p>An entry fee of £100 is payable to Craig at the bar. Although we would prefer if this  money is paid as soon as possible we will agree to £20 a month installments for the first 5 months meaning that all money must be received by 31st December 2017 at the latest.</p>'),
(2, 'about', '<h1>About</h1>'),
(3, 'faqs', '<h1>FAQs</h1>\r\n\r\n<p><strong>How to reset Password - </strong> If you forget your password, currently the only to to reset it is to send us a message using the contact form at the bottom and either telling us what you want it to be or we\'ll pick a random word and inform you. I hope to have a proper password reset function working soon.</p>\r\n\r\n<p><strong>The football scores/points are incorrect - </strong>The scores are updated every 15 fifteen minutes which in turn updates the points, so during matches these are subject to change. If they have not changes then please inform us as the source we get the scores from may not be working.</p>\r\n\r\n<p><strong>When do I have to enter my predictions by - </strong>You will be avaible to change your predictions right up until the kick off at with point the input box will be greyed out.</p>\r\n\r\n<p><strong>If you find any errors please inform us using the contact from below - </strong>The site is still very much under development and it is possible things may not work.</p>'),
(4, 'tsandcs', '<h1>Terms and Conditions</h1>\r\n\r\n<p>This website is used for the sole purpose of recording the predictions of users scores for the 2017/18 season of the spl.</p>\r\n\r\n<p>The site is still very much in a development phase and it is possible things may not work, but we will react to any issues as soon as possible and try to make fix them. Feedback is very much appreciated and useful.</p>\r\n\r\n<p>We don\'t hold any personal data on you, the most we hold is your chosen usernames, your score predictions and your points, all passwords you use are hashed in our database and even we cannot see what they are.</p>\r\n\r\n<p>By using this site you agree to the fact that as things can break during development we are not liable for any loss of the information we hold.</p>');

